function MovieList(props) {
    return (
        <>
            {
                props.movies.map((movie) => {
                    let path = "https://image.tmdb.org/t/p/w185/" + movie.poster_path;
                    return <img className="movie-list" src={path} alt="" />
                })
            }
        </>
    )
}

export default MovieList;
